<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title></title>
    <script src="../node_modules/vue/dist/vue.js"></script>
  </head>
  <body>
    <div id="app">
    </div>
    <script>
      const components = {
        one: { template: '<div>one</div>' },
        two: { template: '<div>two</div>' }
      }
      const { render, staticRenderFns } = Vue.compile(`
        <component :is="view" keep-alive></component>
      `)
      console.log('render', render.toString())
      console.log('staticRenderFns', staticRenderFns.toString())

      const vm = new Vue({
        data: {
          view: 'one'
        },
        components,
        render,
        staticRenderFns
      }).$mount('#app')
    </script>
  </body>
  </body>
</html>
